import { useState } from "react";
import mycontext from "./Createcontext";

const Newdata=(props)=>{
    const mydata=[]
    const [Note,setNote]=useState(mydata)
    //fetch data
    const Getnotes= async()=>{
        let data= await fetch(`http://localh/ost:5000/api/data/mydata`,{
            method:'GET',
            headers:{
                'Content-Type': 'application/json',
                'usertoken':'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJ1c2VyIjp7ImlkIjoiNjViNWYxNmZhMzgwYjJjM2Q4NDljYzQwIn0sImlhdCI6MTcwNjQyMjc0OH0.ecdEptDFDGpaZH5qZqqQvDDiI8OIYWiJMWcfTegDHdI'
            }
        });
        const json=await data.json()
        setNote(json)
    }
return (
<mycontext.Provider value={{Note,Getnotes}} >
    {props.children}
</mycontext.Provider>
);
}

export default Newdata;
